import React from "react";
import { Inject, ScheduleComponent, Day, Week, WorkWeek, Month, 
  Agenda, ViewsDirective, ViewDirective, 
  TimelineViews, TimelineMonth, EventSettingsModel} from '@syncfusion/ej2-react-schedule';
import { DataManager, WebApiAdaptor } from '@syncfusion/ej2-data';
import Navbar from "../Navbar";
import Footer from "../Footer";
import '../Calendar/Calendar.css';

class Calendar extends React.Component<{}, {}> {

  localData = [{
      id: 1,
      Subject: 'Meditation Time',
      StartTime: new Date(2021, 2, 22, 3, 0),
      EndTime: new Date(2021, 2, 22, 4, 30),
      Location: 'Yoga Center'
    },
    {
      id: 2,
      Subject: 'Skating Class',
      StartTime: new Date(2021, 2, 22, 6, 0),
      EndTime: new Date(2021, 2, 22, 7, 30),
      Location: 'Tower Park'
    }];

    render() {
      return (
      <>
      <Navbar/><br/><br/>
      <div className="calendar">
      <ScheduleComponent height='550px' selectedDate={new Date(2021, 2, 22)}
      eventSettings={{ dataSource: this.localeData}}>
        <Inject services={[Day, Week, WorkWeek, Month, Agenda]} />
      </ScheduleComponent>
      </div>
      <Footer />
      </>
      );
   }
}

export default Calendar;
